try {
  const results = await Promise.all([
    calculateDellin(),
    calculatePEK(),
    calculateNordWheel(),
    calculateRailContinent(),
    calculateVozovoz()
  ]);

  // Сортировка по цене
  const sortedResults = results
    .filter(result => !result.error)
    .sort((a, b) => a.price - b.price)
    .concat(results.filter(result => result.error));
